import { ClientCardData } from './clientCardData';
import { ClientCardOptions } from './clientCardOptions';

import '../../styles/rutesListComponentStyle.css';


export const RouteListComponent = ({ routesList: routesList, setRutesList: setRoutesList, rutesCompleted: routesCompleted, setRutesCompleted: setRoutesCompleted }) => {

  
    
  return (
    <>
        <section className = 'RutesListContainer'>

          { routesList.map( (e)=>
          
            <div key = { e.directionRute } className='clientCard'>

              <ClientCardData clientData = { e }/>

              <ClientCardOptions  clientData = { e } 
                                  setRutesList = { setRoutesList } 
                                  rutesList = { routesList }
                                  rutesCompleted = { routesCompleted }
                                  setRutesCompleted = { setRoutesCompleted }/>

            </div>
          
          ) }

        </section>
    </>
   
  )
}
